import React from 'react';
import Toggle from '../Toggle/Toggle.jsx';
import './Navbar.css';
import Nav from 'react-bootstrap/Nav';
import { Link, animateScroll as scroll } from "react-scroll";
import { Element } from 'react-scroll'

const Navbar = () => {
  return (
    <Nav navbarScroll>
          <div className='n-wrapper'>
      <div className='n-left'>
        <div className='n-name'>React-cv</div>
        <Toggle />
      </div>
      <div className='n-right'>
        <div className='n-list'>
          <ul style={{ listStyleType: 'none' }}>
            <Link to="<AboutMe/>" ><li><Link
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}>Home</Link></li></Link>                  
            <Link to="#aboutme" ><li>About Me</li></Link>
            <Link to="#experience" ><li>Experience</li></Link>
          </ul>
        </div>
        <Link to="contact" ><button className='button n-button'>Contact Me</button></Link>
      </div>
    </div>
    </Nav>
  );
};

export default Navbar;
